import React from 'react'
import { Box, Typography } from '@mui/material'
//import Logo from 'public/images/logo-removebg.png'

const Login: React.FC = () => {
  return (
    <Box className='App'>
      <Box sx={{ background: '#332F2F', width: '300px', height: '550px', borderRadius: '20px' }}>
        <Box sx={{ background: '#332F2F', width: '300px', height: '150px', borderTopLeftRadius: '20px', borderTopRightRadius: '20px' }}>
          {/* <Box
            component='img'
            src={Logo}
            alt='Produto'
            sx={{
              width: '160px',
              height: '160px',
              borderRadius: '5px',
              border: '1px solid #E3E3E3',
              opacity: 1,
              marginRight: '20px',
              '@media (max-width: 1350px)': {
                width: '257px'
              },
              '@media (max-width: 665px)': {
                marginRight: '0px'
              }
            }}
          /> */}
          <Typography sx={{ fontSize: '48px' }}>Atlas Endemico</Typography>
        </Box>
        <Box sx={{ background: '#ffffff', width: '300px', height: '400px', borderRadius: '20px', borderTopLeftRadius: '100px', borderTopRightRadius: '0px' }}>
          <Typography sx={{ color: '#000000', fontSize: '32px' }} pt={2}>Login</Typography>
          <Typography sx={{ color: '#000000', fontSize: '20px' }} pt={35}>NÃ£o tem conta? Cadastre-se</Typography>
        </Box>
      </Box>
    </Box>
  )
}

export default Login
